		public virtual List<Global.IFCUnit>? _Units
		{
			get
			{
				if(Units != null)
				{
					List<Global.IFCUnit>? items = new List<Global.IFCUnit>();
					foreach (IFCUnit item in Units)
					{
						items.Add(item);
					}
					return items;
				}
				return null;
			}
			set
			{
				if(value == null)
				{
					Units = null;
